// style.js
import { makeStyles } from "@mui/styles";

export default makeStyles((theme) => ({
  income: {
    border: '10px solid rgba(0, 255, 0, 0.5)',
  },
  expense: {
    border: '10px solid rgba(255, 0, 0, 0.5)',
  }
}));
